INSERT INTO `service_message` (`id`, `service`, `description`, `errorcode`, `recipient`, `en_msg`, `sw_msg`, `tstatus`, `creator`, `modifier`, `authorizer`, `astatus`, `rtimestamp`, `uid`) VALUES
(1, 'MEM_LOANREPAY', 'Overpayment', '403', 'Individual member', 'Amount entered exceeds amount due.', 'Marejesho ya mkopo yamezidi kiasi unachodaiwa.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(2, 'MEM_REQAPPROVAL', '', '200', 'Individual member', 'Code received. Thank you. ', 'Namba ya uthibitisho uliyoingiza imekubaliwa. Ahsante. ', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(3, 'INITGROUP', '', '200', 'ALL', 'You have been added as member {no} of group {grp_name}.\r\nSecretary mobile is {grp_secretary}\r\nChairperson mobile is {grp_chairman}\r\nMin savings between meetings is TZS {grp_min_payin}\r\nLoan interest rate is {grp_loan_service_charge}%\r\nLoan maximum duration is {grp_max_loan_duration} mtgs\r\nMtgs in this cycle are {grp_total_meetings_in_cycle}.\r\n', 'Umejumuishwa katika kikundi {grp_name} na namba yako kama mwanachama ni {no}. \r\nNamba ya simu ya katibu ni {grp_secretary} \r\nNamba ya simu ya mwenyekiti ni {grp_chairman}\r\nKiwango cha chini kinachoruhusiwa kama akiba ktkt ya mikutano ni SH {grp_min_payin} \r\nAda ya huduma ya mkopo ni {grp_loan_service_charge}%\r\nMuda mrefu kabisa wa marejesho ya mkopo ni mikutano {grp_max_loan_duration}\r\nIdadi ya mikutano itakayofanywa kabla ya mgao wa fedha ni {grp_total_meetings_in_cycle}.\r\n', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(4, 'CHG_LOAN_CHARGE', '', '200', 'ALL', 'The interest rate charged for loans will be {req_loancharge}% for each two week period between meetings.', 'Kwa kila mkopo utakaokopwa, mwanachama atalipa ada ya mkopo ya {req_loancharge}% kila wiki mbili zilizo ktkt ya mikutano.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(6, 'SEC_REGISTERLOAN', 'Approved', '200', 'ALL', 'Loan disbursed TZS {req_amount} to member #{req_memberno}. The number of meetings until due is {req_duration}. A payment has been sent to member mobile.', 'Kikundi kimetoa mkopo wa SH {req_amount} kwa mwanachama #{req_memberno}. Mikutano iliyobaki kurejesha mkopo ni {req_duration}. Malipo yametumwa ktk namba ya simu ya mwanachama.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(7, 'CLOSEMEETING', 'Approved', '200', 'ALL', 'Group meeting is closed. ', 'Mkutano wa kikundi umefungwa. ', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(8, 'OPENMEETING', 'Approved', '200', 'ALL', 'Group meeting is in session. ', 'Mkutano wa kikundi umeanza. ', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(9, 'CLOSEMEETING', 'Not approved or failed', '400', 'Chairperson', 'Group meeting is not closed.', 'Mkutano wa kikundi haujafungwa.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(10, 'OPENMEETING', 'Not approved or failed', '400', 'Chairperson', 'The meeting is already open.', 'Mkutano wa kikundi tayari umeanza.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(11, 'GRP_CHG_NAME', '', '200', 'ALL', 'Group name has been set to {req_name}.', 'Jina la kikundi limethibitishwa kuwa {req_name}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(12, 'CREATEGROUP', 'Create group and naming', '200', 'All group members', 'You are creating group {resp_name}. To continue, dial *150*50*90# and enter:\r\nChairperson\r\nMin pay-in\r\nLoan interest rate\r\nMax loan meetings\r\nTotal meetings in cycle.', 'Unaanzisha kikundi {resp_name}. Kabla ya kikundi kuanza kuweka akiba, unahitaji kubonyeza *150*50*90# na kujaza mambo yafuatayo:\r\nMwenyekiti\r\nMchango wa kiwango cha chini unaolipwa ktkt ya mikutano\r\nAda ya huduma ya mkopo ktkt ya mikutano\r\nMuda mrefu kabisa wa marejesho ya mkopo\r\nIdadi ya mikutano kufikia mgao.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(14, 'INITGROUP', 'Less members', '401', 'Secretary', 'Group should have at least {resp_minmember} members and group decisions before continuing.', 'Ombi limekataliwa. Idadi ya wanachama haijatimia {resp_minmember}. Tafadhali ongeza wanachama.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(15, 'MEM_LOANREQUEST', 'Not valid amount', '405', 'Individual member. ', 'Your maximum loan request is TZS {resp_max_loan_available}.', 'Kiwango cha juu cha mkopo unaoweza kuomba ni SH {resp_max_loan_available}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(16, 'MEM_REQAPPROVAL', 'Invalid code', '400', 'Individual member', 'Invalid code.', 'Namba ya uthibitisho uliyoingiza sio sahihi.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(17, 'MEM_LOANREQUEST', 'Not valid duration', '406', 'Individual member', 'Invalid duration. Exceeds maximum loan duration allowed by the group.', 'Muda wa marejesho ya mkopo sio sahihi. Muda uliowekwa umezidi kuliko ule unaoruhusiwa na kikundi.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(24, 'MEM_LOANREQUEST', 'Active Loan', '401', 'Individual member', 'Active loan. Repay loan and then request new loan.', 'Mwanachama una mkopo kwa sasa. Rejesha mkopo wote ili uweze kuomba mwingine.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(26, 'MEM_LOANRECORD', '', '200', 'SELF', 'Member no. {req_memberno}\r\n\r\nLoan date {loandate} \r\nMeetings to repay loan {meetings_left}\r\nAmount {principal} \r\nBalance {principal_due} \r\nInterest due {charge_due}.\r\n', 'Mwanachama namba {req_memberno}\r\n \r\nTarehe ya mkopo {loandate}\r\nMikutano iliyobaki kurejesha mkopo {meetings_left}  \r\nKiasi cha mkopo {principal} \r\nSalio la mkopo {principal_due} \r\nRiba inayodaiwa {charge_due}. \r\n', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(27, 'CHG_LOAN_CHARGE', '', '400', 'Secretary', 'Loan service charge was not changed.', 'Ada ya huduma ya mkopo haikubadilishwa.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(29, 'CHG_MAX_LOAN_PERIOD', '', '400', 'Secretary', 'Max loan duration was not set to {req_loanduration} meetings. ', 'Muda wa marejesho ya mkopo haujaidhinishwa uwe mikutano {req_loanduration}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(30, 'CHG_MAX_LOAN_PERIOD', 'Approved', '200', 'ALL', 'Max loan duration set to {req_loanduration} meetings.', 'Muda wa marejesho ya mkopo umeidhinishwa kuwa mikutano {req_loanduration}. ', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(31, 'SHAREOUT', 'loan was repaid during shareout', '801', 'SELF', 'You had an outstanding loan balance of TZS {req_due}. TZS {req_amount} was repaid from your savings balance.\r\n\r\n', 'You had an outstanding loan balance of TZS {req_due}. TZS {req_amount} was repaid from your savings balance.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(32, 'DROPMEMBER', 'Approved net saver', '200', 'ALL', 'Member #{req_memberno} dropped and payment of TZS {resp_cashoutamount} sent to member mobile. User fee of TZS {resp_userfee} subtracted.', 'Mwanachama namba #{req_memberno} ameondolewa na malipo yake ya SH {resp_cashoutamount} yametumwa kwa namba ya simu. Ada ya SH {resp_userfee} ya kutumia huduma imekatwa.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(33, 'DROPMEMBER', 'Approved net borrower', '201', 'ALL', 'Member #{req_memberno} has been dropped, savings have been pushed to repay loan and the group lost {resp_loanamount}.', 'Mwanachama nambari #{req_memberno} ameondolewa na akiba yake imetumiwa kurejesha mkopo uliosalia lakini kikundi kimepoteza {resp_loanamount}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(36, 'DEATH', 'Approved net saver', '200', 'ALL', 'Member # {req_memberno} has died and a payment of TZS {resp_cashoutamount} has been sent to mobile {req_nominee}. User fee of TZS {resp_userfee} subtracted.', 'Mwanachama namba #{req_memberno} amefariki na malipo yake ya SH {resp_cashoutamount} yametumwa kwa namba ya simu {req_nominee}. Ada ya SH {resp_userfee} ya kutumia huduma imekatwa.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(37, 'DEATH', 'Approved net borrower', '201', 'ALL', 'Member #{req_memberno} has died, savings have been pushed to repay loan and group has lost {resp_loanamount}.', 'Mwanachama namba #{req_memberno} amefariki. Akiba yake imetumiwa kurejesha mkopo uliosalia lakini kikundi kimepoteza {resp_loanamount}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(39, 'CHG_SECRETARY', '', '200', 'ALL', 'Member # {req_memberno} is the new secretary of your group.', 'Mwanachama namba # {req_memberno} ndiye katibu mpya wa kikundi.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(40, 'ADDMEMBER', 'Port init add member', '200', 'ALL', 'Member #{resp_memberno} with phone number {req_mobile} has been added to group {grp_name}.', 'Mwanachama #{resp_memberno} namba ya simu {req_mobile} ameongezwa katika kikundi {grp_name}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(41, 'CHANGEMOBILE', 'Approved', '200', 'ALL', 'Member #{req_memberno} phone number has been changed from {resp_oldmobile} to {req_newmobile}.', 'Namba ya simu ya mwanachama namba #{req_memberno} imebadilishwa kutoka namba {resp_oldmobile} kuwa {req_newmobile}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(42, 'ADDMEMBER', '', '400', 'Secretary', 'Member phone no. {req_mobile} was not added to group.', 'Mwanachama mwenya namba ya simu {req_mobile} hakuongezwa kwenye kikundi.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(44, 'CREATEMEMBER', '', '200', 'Secretary', 'Member {req_mobile} will be added to group {grp_name}. Enter all group members before setting group decisions.', 'Mwanachama {req_mobile} ataongezwa katika kikundi {grp_name}. Ingiza majina yote ya wanachama kabla ya kuweka maamuzi ya kikundi.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(45, 'MEM_LOANRECORD', 'No active loans', '400', 'SELF', 'No active loan.', 'Mwanachama hana mkopo kwa sasa.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(46, 'MEM_WITHDRAWAL', 'Member savings insufficie', '400', 'Individual member', 'Not enough savings balance. ', 'Kiasi cha akiba hakitoshi kutoa fedha. ', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(47, 'SEC_REGISTERLOAN', 'Member Active Loan', '403', 'Individual member', 'Repay active loan in full to request new loan.', 'Mwanachama anao mkopo kwa sasa. Arejeshe mkopo wote ili aweze kuomba mkopo mwingine.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(48, 'GROUPLIST', 'Group List', '200', 'SELF', 'Member no.   Name          Mobile (last 4 digits)\r\n{statement}', 'Namba ya Mwanachama   Jina          Simu(namba 4 za mwisho)\r\n{statement}', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(49, 'MEM_MINISTATEMENT', 'Success', '200', 'SELF', 'Mini statement\r\nSavings balance {totalsavings}\r\nLoan balance {principal_due}\r\nMeetings left of loan {due_meetings}\r\nInterest due {charge_due}\r\n# of meetings in cycle {meetingsleft}. ', 'Taarifa fupi\r\nAkiba {totalsavings}\r\nSalio la mkopo {principal_due}\r\nMikutano iliyosalia ya marejesho ya mkopo {due_meetings}\r\nRiba inayodaiwa {charge_due}\r\nNamba ya mikutano {meetingsleft}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(50, 'CHG_MIN_PAYIN', 'Approved', '200', 'ALL', 'Min pay-in between meetings was set to {req_minpayin}.', 'Mchango wa kiwango cha chini unaolipwa ktkt ya mikutano umethibitishwa kuwa {req_minpayin}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(51, 'CHG_MIN_PAYIN', '', '400', 'Secretary', 'Minimum pay-in between meetings has not been set to {req_minpayin}.', 'Mchango wa kiwango cha chini unaolipwa katikati ya mikutano haujathibitishwa kuwa {req_minpayin}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(54, 'MEM_LOANREPAY', 'Insufficient savings', '402', 'Individual member', 'Not enough savings balance for payment.', 'Salio la akiba halitoshi kulipa marejesho ya mkopo.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(55, 'MEM_LOANREPAY', 'Success', '200', 'Individual member', 'Your loan repayment of TZS {req_amount} accepted.', 'Marejesho ya mkopo ya SH {req_amount} yamekubaliwa.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(67, 'CHG_CHAIRMAN', '', '200', 'ALL', 'Member #{req_memberno} is the new chairperson.', 'Mwanachama namba #{req_memberno} ni mwenyekiti mpya.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(72, 'SHAREOUT', '', '888', 'members', 'Your group {grp_name} has shared out. Your savings was {resp_savings}, your loan balance was {resp_loanbalance} and your profit was {resp_profit}. User fee charged is {resp_userfee}. You have received a total of {resp_total}.', 'Kikundi {grp_name} kimefanya mgao. Akiba yako ilikuwa {resp_savings}. Kiasi cha mkopo kilikuwa {resp_loanbalance}. Faida yako ni {resp_profit}. Ada ya huduma ya mtandao ni {resp_userfee}. Umepokea jumla ya kiasi cha {resp_total}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(73, 'CHANGEMOBILE', 'Not valid number', '400', 'Secretary', 'Request failed. Please enter a valid number.', 'Ombi lako limesitishwa. Tafadhali jaza namba ya simu iliyo sahihi.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(75, 'LOANREMINDER', '', '888', 'Individual member', 'Reminder from group {req_groupname}. Interest due TZS {req_charge_due}. Loan balance TZS {req_principal_due}. Meetings left {req_meetings_left}.', 'Kumbusho kutoka kikundi {req_groupname} \r\nRiba inayodaiwa SH {req_charge_due}. \r\nSalio la mkopo SH {req_principal_due}. \r\nMikutano iliyobaki kulipa mkopo {req_meetings_left}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(76, 'SHAREOUT', '', '200', 'All group members', 'Shareout has initiated. ', 'Mgao umeanza. ', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(77, 'SHAREOUT', '', '403', 'Secretary', 'Shareout has not initiated.', 'Mgao haujaanza.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(78, 'SEC_CHG_MEETINGCNT', 'Approved', '200', 'ALL', 'Shareout meeting has been set to {req_meetings}.', 'Mkutano wa mgao wa fedha umepangiwa kuwa mikutano {req_meetings}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
(80, 'SEC_GRPSTATEMENT', 'Success', '200', 'Secretary', 'Group statement\r\nFunds available {funds_available}\r\nLoans outstanding {loan_outstanding_total}\r\nMeetings to shareout {meetings_remaining}.', 'Ujumbe wa taarifa ya Kikundi\r\nKiasi cha fedha zilizopo {funds_available}\r\nJumla ya mikopo iliyosalia kurejeshwa {loan_outstanding_total} \r\nMikutano iliyobaki kufikia Mgao {meetings_remaining}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-04-05 16:00:45', 0),
