(167, 'ADDMEMBER', 'More than max members', '405', 'SELF', 'The maximum number of members that can be added to a group is {resp_max_members_limit}.', 'Ombi limekataliwa. Idadi ya juu ya wanachama wanaoweza kuongezwa ktk kikundi ni {resp_max_members_limit}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-11-21 13:26:38', 1),
(168, 'SHAREOUT', 'Deafult during shareout', '802', 'ALL', 'Member # {resp_memberno} had more loans than savings at shareout, savings have been pushed to repay loan and the group lost TZS {resp_loss}.', 'Kiasi cha mkopo wa mwanachama namba #{resp_memberno} kilizidi akiba yake. Ilibidi akiba itumiwe kurejesha mikopo lakini kikundi kimepoteza SH {resp_loss}.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-11-23 14:20:48', 1),
(169, 'CHANGEMOBILE', '', '401', 'New number already exists', 'The new mobile number added already exists in another group.', 'Namba mpya uliyoingiza tayari ipo kwenye kikundi nyingine.', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2016-12-08 12:30:31', 1),
(170, 'WITHDRAWAL', 'Loan is past due', '422', NULL, 'You may not withdraw when your loan is overdue', 'Haiwezekani kutoa pesa ukiwa bado na mkopo uliopita muda wa marejesho', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2017-03-21 13:40:13', 1),
(171, 'SHAREOUT', 'Shareout summary to secretary', '889', NULL, 'Lending Activity\r\nLoans issued {resp_loan_issued}\r\nLoans repaid {resp_loan_repaid}\r\nShareout Calculation\r\nSavings {resp_totalsavings}\r\nLoan interests {resp_loan_interest}\r\nSocial payments {resp_social_payment}\r\nLoan losses {resp_loan_loss}\r\nUser fees {resp_userfee}\r\nTotal shared out {resp_total_shareout}', 'Shughuli za mikopo\r\nMikopo iliyotolewa {resp_loan_issued}\r\nMikopo iliyolipwa {resp_loan_repaid}\r\nHesabu ya mgao\r\nAkiba {resp_totalsavings}\r\nZiada ya mkopo {resp_loan_interest}\r\nMalipo ya mfuko wa jamii {resp_social_payment}\r\nMikopo iliyoshindikana {resp_loan_loss}\r\nAda ya huduma ya mtandao {resp_userfee}\r\nJumla ya pesa iliyogawanywa {resp_total_shareout}', 'NEW', 'DEFAULT', 'DEFAULT', 'DEFAULT', 'PENDING', '2017-07-28 06:14:06', 1);
